import { useDispatch, useSelector } from "react-redux";
import { getPokemonId2 } from "../../Redux/Actions/action";
import { useEffect } from "react";
import { useParams } from "react-router-dom";
import style from "./Details.module.css";
import { useNavigate } from "react-router-dom";
import Pokebola from "../../extras/loaderPokebola";
import heart from "./img/heart.png"
import heightx from "./img/height.png"
import running_shoe from "./img/running_shoe.png"
import shield from "./img/shield.png"
import sword from "./img/shield.png"
import weightx from "./img/weight.png"

const Detail = () => {
  const { id } = useParams();

  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(getPokemonId2(id));

    return dispatch(getPokemonId2(""));
  }, []);

  const pokemonIds = useSelector((state) => state.pokemonId);

  const {
    name,
    image,
    life,
    attack,
    defense,
    velocity,
    height,
    weight,
    Types,
  } = pokemonIds;

  const navigate = useNavigate();

  const backToHomeHandler = () => {
    navigate("../home");
  };

  if (name) {
    var nameCorrectly = name.charAt(0).toUpperCase() + name.slice(1);
  }

  return (
    <div className={style.div_general_detail}>
      {image ? (
        <>
          <div
            style={{
              color: "white",
              fontSize: "40px",
              display: "flex",
              alignItems: "end",
            }}
          >
            <h3 className={style.nameTitle}>{nameCorrectly}</h3>
          </div>
          <div className={style.Detail_div}>
            <div>
              <img className={style.image} src={image} alt={nameCorrectly} />
            </div>

            <div className={style.name_caracteristicas}>
              <div className={style.Div_caracteristicas}>
                <div className={style.part_caracteristicas}>
                  <div className={style.div_caract}>
                    <span className={style.div_caract_span}> {heart} Life: </span>
                    <span>{life}</span>
                  </div>
                  <div className={style.div_caract}>
                    <span className={style.div_caract_span}>{sword} Ataque: </span>
                    <span>{attack}</span>
                  </div>
                  <div className={style.div_caract}>
                    <span className={style.div_caract_span}>{shield} Defense: </span>
                    <span>{defense}</span>
                  </div>
                </div>

                <div className={style.part_caracteristicas}>
                  <div className={style.div_caract}>
                    <span className={style.div_caract_span}>{running_shoe} Velocity: </span>
                    <span>{velocity}</span>
                  </div>
                  <div className={style.div_caract}>
                    <span className={style.div_caract_span}>{heightx} Height: </span>
                    <span> {height} m.</span>
                  </div>
                  <div className={style.div_caract}>
                    <span className={style.div_caract_span}>{weightx} Weight: </span>
                    <span>{weight} kg.</span>
                  </div>
                </div>

                <div className={style.part_caracteristicas}>
                  <div className={style.div_caract}>
                    <span className={style.div_caract_span}>Types: </span>
                    <div style={{ paddingBottom: "10px" }}>
                      1{") "}
                      {Types[0]}
                    </div>
                    {Types[1] && (
                      <div>
                        2{") "}
                        {Types[1]}
                      </div>
                    )}
                  </div>
                </div>
              </div>
            </div>
          </div>
        </>
      ) : (
        <Pokebola />
      )}

      <div className={style.div_button}>
        <button onClick={backToHomeHandler}>{"<"} Regresar</button>
      </div>
    </div>
  );
};
export default Detail;
